import React from 'react';

function Card() {
    return (

        <div className="row align-items-center h-25">

            <div className="col-12">.col-9</div>
  <div className="col">.col-4 Since 9 + 4 = 13 &gt; 12, this 4-column-wide div gets wrapped onto a new line as one contiguous unit.</div>

        </div>

    )
}

export default Card;
